import React from "react";

import { FaEdit, FaWindowClose } from 'react-icons/fa'

import "./task.css"

export default function Tasks() {
    return (
        <ul className="tasks">

            {tasks.map((task, index) => (
                <li key={task}>
                   {task}
                    <span>
                        <FaEdit
                            className="edit"
                            onClick={(e) => {this.handleEdit(e, index)}}
                        />

                        <FaWindowClose
                            className="delete"
                            onClick={(e) => { this.handleDelete(e, index)}}
                        />
                    </span>
                </li>
            ))}
        </ul>

    )
}
